import React from 'react';
import ReactDOM from 'react-dom/client';
import VisibleComponent from './Fade';

const root = ReactDOM.createRoot(
  document.querySelector('#root') as HTMLDivElement
)
root.render(
  <div style={{ height: '100vh', display: 'flex', flexDirection: 'column' }}>
    <div style={{ height: '50vh', background: 'lightgrey' }}>
      <VisibleComponent>
        <div style={{ height: '200px', background: 'lightgreen' }}>
          Я появляюсь, когда прокручиваю до меня
        </div>
      </VisibleComponent>
    </div>
    <div style={{ height: '50vh', background: 'lightgrey' }}></div>
  </div>,
);
